import React, { useState } from 'react'
import { Signup } from "./Signup"
import { Login } from "./Login"

export const Auth = () => {

    const [toggle, setToggle] = useState(true)

    return (
        <>
        {

        !toggle ? true 
        (
            <div>
                <Login />
            </div>
        )
        :
        (
            <div>
            <h1>AuthPAge</h1>
            <Signup />
        </div>
        )
        }

        </>
    )
}
